import styled from "styled-components/native";



export const OnboardingNavigationBarContainer = styled.View`
    width: 100%;
    height: 72px;
    justify-content: space-between;
    align-items: center;
    flex-direction: row;
    margin-bottom: 24px;
`;

export const Jump = styled.Text`
    font-size: 20px;
    color: #FFAB09;
`;

export const RightArrow = styled.Image`
    width: 72px;
    height: 72px;
`;
